import React, { useState } from 'react';
import axios from 'axios';
import'./ImportCSV.css'

function ImportCSV() {
  const [trainData, settrainData] = useState(null);
  const [testData, settestData] = useState(null);
  const [graphUrl, setGraphUrl] = useState(null);
  const [graphRowCount, setGraphRowCount] = useState(null);
  const [graphColumnCount, setGraphColumnCount] = useState(null);
  const [countRowCount, setCountRowCount] = useState(null);
  const [countColumnCount, setCountColumnCount] = useState(null);

  const handletrainDataUpload = (event) => {
    settrainData(event.target.files[0]);
  };

  const handletestDataUpload = (event) => {
    settestData(event.target.files[0]);
  };

  const handleGraphUpload = () => {
    const formData = new FormData();
    formData.append('file', trainData);

    axios.post('/upload/graph', formData)
      .then((response) => {
        console.log(response.data);
        if (response.data.success) {
          setGraphUrl(response.data.graph_url);
          setGraphRowCount(response.data.rows);
          setGraphColumnCount(response.data.columns);
          settrainData(response.data.csv_data);


        }
      })
      .catch((error) => {
        console.error(error);
        // Handle error if necessary
      });
  };

  const handleCountUpload = () => {
    const formData = new FormData();
    formData.append('file', testData);

    axios.post('/upload/count', formData)
      .then((response) => {
        console.log(response.data);
        if (response.data.success) {
          setCountRowCount(response.data.rows);
          setCountColumnCount(response.data.columns);
        }
      })
      .catch((error) => {
        console.error(error);
        // Handle error if necessary
      });
  };

  return (
    <div className="container">
      <div className="section">
  <h2>Train Data</h2>
  <input type="file" onChange={handletrainDataUpload} />
  <button onClick={handleGraphUpload}>Upload</button>

  {graphUrl && (
    <div className="result">
      <img src={graphUrl} alt="Graph" />
      <p>Graph Rows: {graphRowCount}</p>
      <p>Graph Columns: {graphColumnCount}</p>
    </div>
  )}
</div>


      <div className="section">
  <h2>Test Data</h2>

  <input type="file" onChange={handletestDataUpload} />
  <button onClick={handleCountUpload}>Upload</button>

  {countRowCount !== null && countColumnCount !== null && (
    <div className="result">
      <p>Count Rows: {countRowCount}</p>
      <p>Count Columns: {countColumnCount}</p>
    </div>
  )}
</div>

    </div>
  );
}

export default ImportCSV;
